 // TODO: accept NgIterable<T> return type\\n  @Input(\'clrRecursiveForGetChildren\') getChildren: (node: T) => AsyncArray<T>;\\n\\n  private childrenFetchSubscription: Subscription;\\n\\n  // I\'m using OnChanges instead of OnInit to easily keep up to date with dynamic trees. Maybe optimizable later.\\n  ngOnChanges() {\\n    let wrapped: RecursiveTreeNodeModel<T>[];\\n    if (Array.isArray(this.nodes)) {\\n      wrapped = this.nodes.map(node => new RecursiveTreeNodeModel(node, null, this.getChildren, this.featuresService));\\n    } else {\\n      wrapped = [new RecursiveTreeNodeModel(this.nodes, null, this.getChildren, this.featuresService)];\\n    }\\n    if (!this.childrenFetchSubscription) {\\n      this.childrenFetchSubscription = this.featuresService.childrenFetched.pipe(debounceTime(0)).subscribe(() => {\\n        this.cdr.detectChanges();\\n      });\\n    }\\n\\n    this.featuresService.recursion = {\\n      template: this.template,\\n      root: wrapped,\\n    };\\n  }\\n\\n  ngOnDestroy() {\\n    if (this.childrenFetchSubscription) {\\n      this.childrenFetchSubscription.unsubscribe();\\n    }\\n  }\\n}\\n","properties":[{"name":"$implicit","type":"T","optional":false,"description":"","line":16},{"name":"clrModel","type":"TreeNodeModel<T>","optional":false,"description":"","line":17}],"indexSignatures":[],"kind":150,"methods":[]},{"name":"ClrVisibilityCoords","id":"interface-ClrVisibilityCoords-d1737389d204cbdbb604865836bcf088","file":"clarity-src/packages/angular/projects/clr-angular/src/utils/popover/interfaces/visibility-coords.interface.ts","type":"interface","sourceCode":"export interface ClrVisibilityCoords {\\n  bottom: number;\\n  left: number;\\n  top: number;\\n  right: number;\\n}\\n","properties":[{"name":"bottom","type":"number","optional":false,"description":"","line":9},{"name":"left","type":"number","optional":false,"description":"","line":10},{"name":"right","type":"number","optional":false,"description":"","line":12},{"name":"top","typ